import React from 'react'

import { Navigate, useNavigate } from 'react-router-dom'

export default function Home() {

  const navigate = useNavigate()
  return (
    <>
      <div>Home</div>
      <button onClick={ () => { Math.random() > .5 ? navigate() : navigate()} }>Confirm Order :D</button>
    </>
  )
}
